import React, { Component } from 'react';
import "./Footer.css";
import { FaGithub,FaLinkedin,FiMail} from "react-icons/fa";

class Footer extends Component{
    render(){
        return(
            <div className="footer-container">
                        <FaGithub/>
                        <FaLinkedin/>
                        <FiMail/>

            </div>
        )
    }
}

export default Footer;
